import React, {useState, useEffect} from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Login from './components/Login';
import Register from './components/Register';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
//use react-router-dom to change urls
function App() {
  const [loggedInStatus, setLoggedInStatus] = useState("NOT Logged in");

  const handleSuccess = () => {
    setLoggedInStatus("Logged in");
  }
    return (
    <div>

    <Router>
      <div>
        <Switch>

          <Route path="/" exact render = {props => (
            <Dashboard {...props} loggedIn = {loggedInStatus}/>
          )}/>
          <Route path="/login" exact render = {props=>(
            <Login {...props} loggedIn = {loggedInStatus}/>
          )}/>
          <Route path="/register" exact render = {props=>(
            <Register {...props} loggedIn = {loggedInStatus} handleSuccess={handleSuccess}/>
          )}/>

        </Switch>
      </div>
    </Router>
    </div>

  );



}

export default App;
